import React, { Component,useState } from 'react'
import './cellphone.css'
const Cellphone=()=>{
    const phone=[
        {title:'hello',text:'behnam',src:"https://www.19kala.com/image/cache/home-page/slide-show/zemestan-98/esfand/desktop/new/slideshow-huawei-n1-1300x460.jpg"},
        {title:'hello',text:'behnam',src:"https://www.19kala.com/image/cache/home-page/slide-show/zemestan-98/esfand/desktop/new/slideshow-huawei-n1-1300x460.jpg"},
        {title:'hello',text:'behnam',src:"https://www.19kala.com/image/cache/home-page/slide-show/zemestan-98/esfand/desktop/new/slideshow-huawei-n1-1300x460.jpg"},
        {title:'hello',text:'behnam',src:"https://www.19kala.com/image/cache/home-page/slide-show/zemestan-98/esfand/desktop/new/slideshow-huawei-n1-1300x460.jpg"},
    ]
    const showCellphone=phone.map((phone)=>
       <img src={phone.src} className="cellphoneImage" style={{width:'100%'}}/>
    )
 
    return(
        <div className="maincellphone">
                    
           <div className="cellphonecards">
     
             {showCellphone}
           </div>
 
        </div>

    )
}
export default Cellphone;
